def seaborn_histogram(data, x, bins=None, color=None, edgecolor=None, xlabel=None, ylabel=None, title=None):
    """
    Create a histogram using Seaborn.
    
    Parameters:
        data (DataFrame or array-like): Input data.
        x (str): Column name or array-like values to plot on x-axis.
        bins (int or sequence, optional): Number of bins or bin edges. Default is None.
        color (str, optional): Color of the bars. Default is None.
        edgecolor (str, optional): Color of the edges of the bars. Default is None.
        xlabel (str, optional): Label for the x-axis. Default is None.
        ylabel (str, optional): Label for the y-axis. Default is None.
        title (str, optional): Title for the plot. Default is None.
    
    Returns:
        None
    """
    sns.histplot(data=data, x=x, bins=bins, color=color, edgecolor=edgecolor)
    
